// Filename - pages/about.js
 
import React from "react";

const learnLanguages = [
    "Norsk",
    "Francais",
    "Italiano"
];

function DropDown(propds) {
    return (
        <select name="exampleDropdown" id="exampleDropdown">

        {propds.list.map((opt) => {
            return(
                <option value="option1">{opt}</option>
            ) 
        })}

        </select>
    );
}
 
const About = () => {
    return (
        <div>
            <h1>Login</h1>
            <h1>
                Learn
            </h1>
            <DropDown list={learnLanguages} />
            <h1>
                Using
            </h1>
            <select name="exampleDropdown" id="exampleDropdown">
                <option value="option1">Option 1</option>
                <option value="option2">Option 2</option>
                <option value="option3">Option 3</option>
            </select>
            <button>Launch Chatroom</button>
        </div>
    );
};
 
export default About;
